import{_ as e,c as o,o as i,ae as l}from"./chunks/framework.Dh1jimFm.js";const m=JSON.parse('{"title":"贡献指南","description":"","frontmatter":{},"headers":[],"relativePath":"community/contributing.md","filePath":"community/contributing.md"}'),r={name:"community/contributing.md"};function s(n,t,a,u,c,g){return i(),o("div",null,t[0]||(t[0]=[l('<h1 id="贡献指南" tabindex="-1">贡献指南 <a class="header-anchor" href="#贡献指南" aria-label="Permalink to &quot;贡献指南&quot;">​</a></h1><p>欢迎你为 ALLinSSL 项目做出贡献！我们非常感谢社区的支持。</p><p>你可以通过多种方式参与贡献：</p><h2 id="报告-bug-report-bugs" tabindex="-1">报告 Bug (Report Bugs) <a class="header-anchor" href="#报告-bug-report-bugs" aria-label="Permalink to &quot;报告 Bug (Report Bugs)&quot;">​</a></h2><p>如果你在使用 ALLinSSL 时遇到了问题或发现了 Bug，请通过以下方式报告：</p><ol><li><strong>搜索现有 Issue:</strong> 在提交新 Bug 报告之前，请先在 <a href="https://github.com/allinssl/allinssl/issues" target="_blank" rel="noreferrer">GitHub Issues</a> 中搜索是否已有类似报告。</li><li><strong>创建新 Issue:</strong> 如果没有找到相关的 Issue，请创建一个新的 Issue。 <ul><li><strong>标题:</strong> 清晰地描述问题。</li><li><strong>内容:</strong> 提供尽可能详细的信息，包括： <ul><li>你使用的 ALLinSSL 版本。</li><li>你的操作系统和环境信息。</li><li>复现问题的具体步骤。</li><li>期望的结果是什么。</li><li>实际发生了什么（包括错误消息、截图等）。</li></ul></li></ul></li></ol><h2 id="提交功能请求-feature-requests" tabindex="-1">提交功能请求 (Feature Requests) <a class="header-anchor" href="#提交功能请求-feature-requests" aria-label="Permalink to &quot;提交功能请求 (Feature Requests)&quot;">​</a></h2><p>如果你对 ALLinSSL 有新的功能想法或改进建议：</p><ol><li><strong>搜索现有 Issue:</strong> 同样，先在 <a href="https://github.com/allinssl/allinssl/issues" target="_blank" rel="noreferrer">GitHub Issues</a> 中搜索是否已有类似的功能请求。</li><li><strong>创建新 Issue:</strong> 创建一个新的 Issue，清晰地描述你想要的功能： <ul><li>说明这个功能要解决什么问题或带来什么价值。</li><li>描述你期望的功能是如何工作的。</li><li>(可选) 提供一些使用场景示例。</li></ul></li></ol><h2 id="参与代码贡献-code-contributions" tabindex="-1">参与代码贡献 (Code Contributions) <a class="header-anchor" href="#参与代码贡献-code-contributions" aria-label="Permalink to &quot;参与代码贡献 (Code Contributions)&quot;">​</a></h2><p>我们欢迎代码贡献！如果你想修复 Bug 或实现新功能，请遵循以下流程：</p><ol><li><strong>Fork 仓库:</strong> Fork <a href="https://github.com/allinssl/allinssl" target="_blank" rel="noreferrer">ALLinSSL 主仓库</a> 到你自己的 GitHub 账号。</li><li><strong>Clone 你的 Fork:</strong> <code>git clone https://github.com/YOUR_USERNAME/allinssl.git</code></li><li><strong>创建分支:</strong> <code>git checkout -b my-feature-or-fix</code> (使用有意义的分支名)</li><li><strong>进行修改:</strong> 编写你的代码和测试。</li><li><strong>Commit 修改:</strong> <code>git commit -am &#39;feat: Add some feature&#39;</code> (遵循一定的 Commit 规范，如 <a href="https://www.conventionalcommits.org/" target="_blank" rel="noreferrer">Conventional Commits</a>)</li><li><strong>Push 到你的 Fork:</strong> <code>git push origin my-feature-or-fix</code></li><li><strong>创建 Pull Request (PR):</strong> 在 GitHub 上，从你的分支向 <code>allinssl/allinssl</code> 的主分支（通常是 <code>main</code> 或 <code>master</code>）发起 Pull Request。 <ul><li>在 PR 描述中清晰说明你做了什么修改，解决了哪个 Issue (如果相关，使用 <code>Fixes #123</code>)。</li></ul></li></ol><p>项目维护者会审查你的 PR，并可能提出修改建议。一旦通过，你的代码就会被合并！</p><h2 id="改进文档-documentation" tabindex="-1">改进文档 (Documentation) <a class="header-anchor" href="#改进文档-documentation" aria-label="Permalink to &quot;改进文档 (Documentation)&quot;">​</a></h2><p>发现文档有错误、不清晰或缺失？改进文档也是重要的贡献！</p><ul><li>你可以直接在文档页面底部找到&quot;在 GitHub 上编辑此页面&quot;的链接，直接在线修改并发起 PR。</li><li>或者按照代码贡献的流程来修改文档文件。</li></ul><p>感谢你的时间和贡献！</p>',17)]))}const h=e(r,[["render",s]]);export{m as __pageData,h as default};
